import React from 'react';
import './navMenu.css';

function Menu (){
    return (
        <nav className="menu">
            <ul>
                <li>Home</li>
                <li>Calculadora</li>
                <li>Sobre</li>
            </ul>
        </nav>
    );
};
export default Menu;
